import { createTheme } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    primary: {
      main: '#f28482', // Example primary color
    },
    secondary: {
      main: '#f6bd60', // Example secondary color
    },
    // Add additional colors as needed
  },
});

export default theme;
